import React from 'react';

const Education = () => {
  return (
    <div name='Education' className='w-full h-screen bg-[#0a192f] text-gray-300'>
      <div className='flex flex-col justify-center items-center w-full h-full'>
        <div className='max-w-[1000px] w-full grid grid-cols-2 gap-8'>
          <div className='sm:text-center'>
            <p className='text-4xl font-bold sm:text-left'>
              Education
            </p>
          </div>
          </div>
          <div className='max-w-[1000px] w-full grid sm:text-center'>
            <div className='sm:text-center text-2xl font-bold'>
              <p>University of Maryland, College Park</p>
              <p>B.S. Computer Science</p>
              <p className='text-xl font-bold'>Excepted Graduation: May 2024</p>
          </div>
          </div>
        </div>
      </div>
  );
};

export default Education;
